import { Injectable } from '@angular/core';

@Injectable({
  providedIn: 'root'
})
export class FormService {
  formStructure = [
    {
      "type": "text",
      "label": "Ala",
      "name": "ala"
    },
    {
      "type": "number",
      "label": "Ma",
      "name": "ma"
    },
    {
      "type": "text",
      "label": "Name",
      "name": "name"
    }


  ];

  getFormStructure() {
    return this.formStructure;
  }
}
